pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./Interfaces/IGame.sol";
import "./Interfaces/IMarketPlace.sol";
import "./Interfaces/IMverse.sol";

import "hardhat/console.sol";

contract MaticVerseFarmer is IERC721Receiver {
    IGame private constant game =
        IGame(0xc16B75aA166D94Cc6A437e433d1C519Bc1d89Cc0);
    IMarketPlace private constant babyV =
        IMarketPlace(0xA4D780f0c4CeB3787291894821516D55337a9768);
    IMverse private constant mverse =
        IMverse(0xFEb090FcD433dE479396E82DB8B83a470dbAD3c9);
    address payable public treasury;
    address public admin;
    uint256 internal contractBalance = 0;
    uint256 public fee;
    uint256 public feePercent = 0;
    event RewardsClaimed(
        address player,
        uint256 userBalance,
        uint256 feeAmount,
        uint256 amountPayedOut
    );
    event FightWon(
        address player,
        uint256 reward,
        uint256 newBalance,
        uint256 wins
    );
    event TransferBack(address player, uint256 tokenId);

    enum NFTState {
        LOCKED,
        UNLOCKED
    }
    mapping(uint256 => NFTState) public heroStates;
    mapping(uint256 => address) public ownership;
    mapping(address => uint256) public balances;
    mapping(address => uint256) public gamesWon;
    mapping(address => uint256[]) public playerHeros;

    constructor(
        address _admin,
        address payable _treasury,
        uint256 _fee
    ) {
        treasury = _treasury;
        admin = _admin;
        fee = _fee;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin);
        _;
    }

    function setFee(uint256 _fee) public onlyAdmin {
        fee = _fee;
    }

    function setTreasury(address payable _treasury) public onlyAdmin {
        treasury = _treasury;
    }

    function setAdmin(address _admin) public onlyAdmin {
        admin = _admin;
    }

    function getGameBalance() internal view returns (uint256) {
        uint256 balance = game.userBalance(address(this));
        return balance;
    }

    function autofight(uint256 _tokenid, uint256 boss_number)
        public
        returns (bool)
    {
        require(heroStates[_tokenid] == NFTState.UNLOCKED, "NFT not Unlocked");
        game.fight(boss_number, _tokenid);
        uint256 newBalance = getGameBalance();
        if (newBalance > contractBalance) {
            address player = ownership[_tokenid];
            balances[player] =
                balances[player] +
                (newBalance - contractBalance);
            gamesWon[player]++;
            contractBalance = newBalance;
            emit FightWon(
                player,
                newBalance - contractBalance,
                balances[player],
                gamesWon[player]
            );
            return true;
        }
        return false;
    }

    function claimRewards() public returns (uint256) {
        uint256 b = balances[msg.sender];
        if (mverse.balanceOf(address(this)) < b) {
            uint256 oldBalance = getGameBalance() +
                mverse.balanceOf(address(this));
            game.claim();
            // calculate diff => subtracting balance before claim() with current balance
            // calculate percentage in basis points => diff/oldBalance * 10000
            feePercent =
                ((oldBalance - mverse.balanceOf(address(this))) / oldBalance) *
                10000;
            // get fee in token amount from user balance => feePercent * balance / 10000
            uint256 feeAmount = (feePercent * b) / 10000;
            balances[msg.sender] = 0;
            uint256 cBalance = mverse.balanceOf(address(this));
            if ((b - feeAmount) > cBalance) {
                mverse.transfer(msg.sender, cBalance);
                emit RewardsClaimed(msg.sender, b, feeAmount, cBalance);
                return cBalance;
            } else {
                mverse.transfer(msg.sender, b - feeAmount);
                emit RewardsClaimed(msg.sender, b, feeAmount, b - feeAmount);
                return b - feeAmount;
            }
        } else {
            uint256 feeAmount = (feePercent * b) / 10000;
            balances[msg.sender] = 0;
            mverse.transfer(msg.sender, b - feeAmount);
            emit RewardsClaimed(msg.sender, b, feeAmount, b - feeAmount);
            return b - feeAmount;
        }
    }

    function transferBack(uint256 tokenId) public {
        require(ownership[tokenId] == msg.sender, "Not your NFT");
        delete ownership[tokenId];
        for (uint256 i = 0; i < playerHeros[msg.sender].length; i++) {
            if (i == tokenId) {
                remove(i, msg.sender);
                break;
            }
            continue;
        }
        babyV.approve(0xA4D780f0c4CeB3787291894821516D55337a9768, tokenId);
        babyV.Gift(tokenId, msg.sender);
        emit TransferBack(msg.sender, tokenId);
    }

    function unlockNFT(uint256 tokenId) public payable {
        require(msg.value >= fee, "pay fee");
        treasury.transfer(msg.value);
        heroStates[tokenId] = NFTState.UNLOCKED;
    }

    function adminUnlockNFT(uint256 tokenId) public onlyAdmin {
        if (heroStates[tokenId] == NFTState.LOCKED) {
            heroStates[tokenId] = NFTState.UNLOCKED;
        } else {
            heroStates[tokenId] = NFTState.LOCKED;
        }
    }

    function onERC721Received(
        address,
        address from,
        uint256 tokenId,
        bytes memory
    ) public virtual override returns (bytes4) {
        heroStates[tokenId] = NFTState.LOCKED;
        ownership[tokenId] = from;
        playerHeros[from].push(tokenId);
        return this.onERC721Received.selector;
    }

    receive() external payable {
        treasury.transfer(msg.value);
    }

    function remove(uint256 index, address player) internal {
        // Move the last element into the place to delete
        playerHeros[player][index] = playerHeros[player][
            playerHeros[player].length - 1
        ];
        // Remove the last element
        playerHeros[player].pop();
    }
}
